Modern CPUs often use speculative execution , where instructions following a branch (e.g. if) are executed before knowing the result. Once the branch path is known, the correct result is used. Consider the following example: #[target_feature(enable = "avx")]
unsafe fn avx_fn() { println!("This function uses AVX.")
} if is_x86_feature_detected!("avx") { unsafe { avx_fn() }
} If speculative execution was used with this branch, the CPU might try to execute an AVX instruction before knowing if it even supports it, potentially crashing the program. Fortunately, speculative execution stops at function calls, so #[target_feature] avoids this by also preventing inlining. Since non-inlined function calls can be slow, try to use one large function tagged with #[target_feature], rather than many separate functions. Additionally, multiple uses of #[target_feature] may not be necessary, as explained in the next paragraph. Info Functions with #[target_feature] can still inline into other functions that support the same features via #[target_feature] or the -Ctarget-feature flag.

