When a function is inlined into another function tagged with #[target_feature], the inlined function is also compiled with those target features. To help ensure inlining, the #[inline] attribute can be used. This behavior can be used to write functions without worrying about what the final target features will be—in fact, this is what portable SIMD does! Functions in std::simd are inlined, allowing the user to specify the target features. In the following example, all of the code is generated using AVX, because it’s all inlined into the function with #[target_feature]: # #![feature(portable_simd)]
# fn main() {}
use std::simd::f32x4; #[inline]
fn double(x: f32x4) -> f32x4 { x * f32x4::splat(2.0) // The `splat` and `*` functions are inlined here
} #[target_feature(enable = "avx")]
unsafe fn double_avx(x: f32x4) -> f32x4 { double(x) // The `double` function is inlined here
}

