Unlike arrays, Simd<T, N> is not just a container. While it looks like an array, it also operates like T. Vectors implement all of the same basic operators as its scalar type T, meaning you can do the following: # #![feature(portable_simd)]
# fn main() {}
use std::simd::f32x4; // an alias for Simd<f32, 4> /// y = mx + b
fn y(m: f32x4, x: f32x4, b: f32x4) -> f32x4 { m * x + b
} These operators work elementwise , meaning the operator is applied to each element separately. Vectors even implement special functions (e.g. abs) with traits: # #![feature(portable_simd)]
# fn main() {}
use std::simd::{f32x4, SimdFloat}; // SimdFloat provides abs /// |a - b|
fn distance(a: f32x4, b: f32x4) -> f32x4 { (a - b).abs()
}

