Sometimes you may want to perform an operation across a single vector, rather than between vectors. These operations are referred to as reductions : # #![feature(portable_simd)]
# fn main() {}
use std::simd::{f32x4, SimdFloat}; // SimdFloat provides reduce_sum fn sum(vectors: &[f32x4]) -> f32 { let mut sums = f32x4::splat(0.0); // splat fills each element with the value for v in vectors { sums += v; } // `sums` now contains the elementwise sums, so we must sum across the vector sums.reduce_sum()
} Note Reductions are slower than elementwise operations in most cases. It’s best to use elementwise operations when possible, and use reductions only when necessary.
